def find_rectangles(lengths):
    count = 0
    for i in range(len(lengths)):
        for j in range(i + 1, len(lengths)):
            for k in range(j + 1, len(lengths)):
                for l in range(k + 1, len(lengths)):
                    if lengths[i] * lengths[j] == lengths[k] * lengths[l]:
                        count += 1
    return count

lengths = [1, 2, 3, 4, 6, 8, 12]
print(find_rectangles(lengths))  # Output: 21
